//-------------------------------------------------------------------------------

var Rust = {};
Rust.load = function() {

    ace.define('ace/snippets/rust', ['require', 'exports', 'module' ], function(require, exports, module) {
        
        
        exports.snippetText = "";
        exports.scope = "rust";
        
        });
        
};

//-------------------------------------------------------------------------------
// Exports
//-------------------------------------------------------------------------------

bugpack.export('acesnippets.Rust', Rust);
